import { UsersAction, UsersState, } from "../../store/actions/";


export const usersState = [];
export const UsersReducer=(state = usersState, action: UsersAction): UsersState => {
    switch (action.type) {
        case "GET_ALL_USERS":
            return [
                state,
                 ...action.users
            ];
        case "SORT_ALL_USER": {
            return [
                state,
                ...action.users
            ]
        }
        default:
            return state
        }   
}
